import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import styles from './Header.module.css';

export const Header = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [isSignIn, setIsSignIn] = useState(true); // Toggle between Sign In and Sign Up
  const navigate = useNavigate();

  const toggleModal = () => setIsModalOpen(!isModalOpen);
  const handleSignInClick = () => {
    navigate('/signin');
    setIsModalOpen(false); // Close modal after navigating
  };
  const handleSignUpClick = () => {
    navigate('/signup');
    setIsModalOpen(false);
  };
  const handleForgotPasswordClick = () => {
    navigate('/resetpassword');
    setIsModalOpen(false);
  };

  return (
    <header className={styles.header}>
      <div className={styles.headerContent}>
        <div className={styles.logoContainer}>
          <Link to="/">
            <img 
              src="https://cdn.builder.io/api/v1/image/assets/TEMP/bcc09774b4dd341bcb6a90cb4b35b19922586f4028b83c62a4e7d616d3addb3e?placeholderIfAbsent=true&apiKey=aa0c3b8d094f45b48d52977318229ea8" 
              alt="Bee RushTech Logo" 
              className={styles.logo} 
            />
          </Link>
          <Link to="/" className={styles.brandName}>
            <h1>Bee RushTech</h1>
          </Link>
        </div>
        <nav className={styles.navigation}>
          <ul className={styles.navLinks}>
            <li><Link to="/category">Shop</Link></li>
            <li><Link to="/sale">On Sale</Link></li>
            <li><Link to="/category">New Arrivals</Link></li>
            <li><Link to="/brands">Brands</Link></li>
          </ul>
          <form className={styles.searchForm}>
            <input
              type="search"
              placeholder="Search for products..."
              className={styles.searchInput}
              aria-label="Search for products"
            />
          </form>
          <div className={styles.userActions}>
            <button className={styles.iconButton} aria-label="User account" onClick={toggleModal}>
              <img src="path/to/user-icon.png" alt="User Account" />
            </button>
            <Link to="/cart" className={styles.iconButton} aria-label="Shopping cart">
              <img src="path/to/cart-icon.png" alt="Shopping Cart" />
            </Link>
          </div>
        </nav>
      </div>

      {/* Modal Popup */}
      {isModalOpen && (
        <div className={styles.modalOverlay}>
          <div className={styles.modalContent}>
            <button onClick={toggleModal} className={styles.closeButton}>×</button>
            <div className={styles.tabContainer}>
              <button
                className={`${styles.tab} ${isSignIn ? styles.activeTab : ''}`}
                onClick={() => setIsSignIn(true)}
              >
                Sign In
              </button>
              <button
                className={`${styles.tab} ${!isSignIn ? styles.activeTab : ''}`}
                onClick={() => setIsSignIn(false)}
              >
                Sign Up
              </button>
            </div>
            {isSignIn ? (
              <div className={styles.formContainer}>
                <h2>Sign In</h2>
                <form>
                  <input type="email" placeholder="Email" className={styles.inputField} />
                  <input type="password" placeholder="Password" className={styles.inputField} />
                  <button type="button" className={styles.submitButton} onClick={handleSignInClick}>Sign In</button>
                </form>
                <button onClick={handleForgotPasswordClick} className={styles.forgotPassword}>
                  Forgot Password?
                </button>
              </div>
            ) : (
              <div className={styles.formContainer}>
                <h2>Sign Up</h2>
                <form>
                  <input type="text" placeholder="Username" className={styles.inputField} />
                  <input type="email" placeholder="Email" className={styles.inputField} />
                  <input type="password" placeholder="Password" className={styles.inputField} />
                  <button type="button" className={styles.submitButton} onClick={handleSignUpClick}>Sign Up</button>
                </form>
              </div>
            )}
          </div>
        </div>
      )}
    </header>
  );
};
